/** Removes and returns the least scorer of the ScorerDocQueue in log(size)
 * time.
 * Should not be used when the queue is empty.
 */
public final Scorer pop() {
  // assert size > 0;
  Scorer result = topHSD.scorer;
  popNoResult();
  return result;
}

